import styled from "@emotion/styled";

export const Layout = styled.div``;

export const LayoutContent = styled.div`
  max-width: calc(100% - 208px);
  position: relative;
  max-width: calc(100% - 208px);

  & > div {
    display: flex;
    flex-wrap: wrap;
  }
`;
